import React from 'react';

const Select = () => {
    const styleObj = {
        background:'none',
	    backgroundColor:'#fbfbfb',
	    border:'2px solid #d5d5d5',
        boxShadow: 'none',
  	    // color: '#999',
	    height:'44px',
	    fontSize:'16px',
	    fontWeight:'400',
	    fontFamily: 'Open Sans, Arial, sans-serif',
	    lineHeight: '1.428571429',
	    padding: '5px 10px'
    }
    return (
        <select style={styleObj}>
            <option val="AZ">Arizona</option>
        </select>
    )
}

export default Select;
